ange, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2219726","type":"CustomJS"},{"attributes":{},"id":"2219764","type":"BasicTickFormatter"},{"attributes":{},"id":"2219655","type":"LinearScale"},{"attributes":{},"id":"2219664","type":"BasicTicker"},{"attributes":{"dimensions":"width"},"id":"2219339","type":"PanTool"},{"attributes":{"data":{},"selected":{"id":"2219430"},"selection_policy":{"id":"2219429"}},"id":"2219412","type":"ColumnDataSource"},{"attributes":{"overlay":{"id":"2219346"}},"id":"2219341","type":"BoxZoomTool"},{"attributes":{"source":{"id":"2219355"}},"id":"2219407","type":"CDSView"},{"attributes":{},"id":"2219342","type":"UndoTool"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"2219340","type":"WheelZoomTool"},{"attributes":{"axis":{"id":"2219335"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"22193
